const music = new Audio()
let num_card = 0
let intents = 0

window.onload = () => {
    setArrows()
    printImage()
}

function changePage(direction) {
    if (direction == 'back' && num_card > 0) {
        num_card--
        printImage()
        setArrows()
    } else if (direction == 'next' && num_card != words.length - 1) {
        num_card++
        printImage()
        setArrows()
    }
}

function printImage() {
    document.querySelector('#btn-next').classList.remove('animate-button')
    document.getElementById('poster-container').innerHTML = ''
    document.getElementById('poster-container').innerHTML = `
        ${words[num_card].url}
    `

    _.forEach(words[num_card].options, function (person, key) {
        let element = document.getElementById(Object.keys(person))
        element.style.cssText = 'opacity: 0.6;'

        if (num_card < words.length - 1) {
            setTimeout(() => {
                document
                    .querySelector('#btn-next')
                    .classList.add('animate-button')
            }, 1000)
        }

        element.addEventListener('mouseenter', function () {
            synth.cancel()
            playSound(`${Object.values(person)[0]}`)

            intents++
        })

        element.addEventListener('mouseover', function () {
            element.style.cssText = 'opacity: 1;'
        })

        element.addEventListener('mouseout', function () {
            element.style.cssText = 'opacity: 0.6;'
        })
    })
}

function setArrows() {
    if (num_card == 0) {
        document.getElementById('back').style.filter = 'grayscale(1)'
        document.getElementById('back').disabled = true
        document.getElementById('btn-next').style.filter = 'grayscale(0)'
        document.getElementById('btn-next').disabled = false
    } else if (num_card == words.length - 1) {
        document.getElementById('back').style.filter = 'grayscale(0)'
        document.getElementById('back').disabled = false
        document.getElementById('btn-next').style.filter = 'grayscale(1)'
        document.getElementById('btn-next').disabled = true
    } else if (num_card != words.length) {
        document.getElementById('back').style.filter = 'grayscale(0)'
        document.getElementById('back').disabled = false
        document.getElementById('btn-next').style.filter = 'grayscale(0)'
        document.getElementById('btn-next').disabled = false
    }
}

function playSound(name_sound) {
    music.src = `./assets/audios/${name_sound}.mp3`
    music.play()
}
